import React, { Component } from 'react';
import 'react-bootstrap';
import { Button } from 'react-bootstrap';


export default class FullName extends Component {
    continue = e => {
        e.preventDefault();
        this.props.nextStep();
    }
    render() {
        return (
            <div>
                <h1>
                    HI!Enter the name
                </h1>
                <Button onClick={this.continue}>Next</Button>
            </div>
        )
    }

}

